import Image1 from './NewPic.jpg';

export default function About() {

    return (

        <section id="about" className="px-10 w-full flex flex-col lg: flex-row py-20 align-center bg-emerald-200 max-w-5x1 mx-auto">

            <div className="flex-1">

                <img src={Image1} style={{width:200}} alt="About" className="w-full h-full bg-cover" />

            </div>

            <div className="flex-1 flex flex-col justify-center items-center gap-5 px-6">

                <div>

                    <h2 className="text-center text-red-500 text-5xl font-bold">About Me: </h2>

                </div>

                <p>"Aspiring Full Stack Developer | Skilled in Java, JavaScript, HTML, CSS, and MySQL | Open to Opportunities"</p>

                <p>A Java Full Stack Developer is a skilled software engineer proficient in both front-end and back-end development
                    using Java technologies. On the back-end, they use Java frameworks. For the front-end, they are knowledgeable
                    in HTML, CSS, JavaScript. A strong understanding of database management SQL  is often required.</p>

            </div>

        </section>

    );

}
